
document.head = document.head || document.getElementsByTagName('head')[0];

function changeFavicon(src) {
    var link = document.createElement('link'),
        oldLink = document.getElementById('dynamic-favicon');
    link.id = 'dynamic-favicon';
    link.rel = 'shortcut icon';
    link.href = src;
    if (oldLink) {
        document.head.removeChild(oldLink);
    }
    document.head.appendChild(link);
}

const iconBase64 = "data:image/png;base64,"

changeFavicon(iconBase64);
async function getItemFromChromeStorage(key) {
	/* utility function allows to get items from chome storage */
	try {
		let data = await chrome.storage.local.get(key);
		data = await data[key];
		if (data.length == 0) return false;
		return data;
	} catch (error) {
		return false;
	}
}
